        <li>You can make more friends in 2 months by being genuinely interested in other people than you can in 2 years by trying to get other people interested in you</li>
        <li>People are not interested in you - they are interested in themselves</li>
        <li>Become genuinely interested in other people</li>
      </ul>
    </div>
  )
}
